import React from 'react';
import { StyleSheet, View } from 'react-native';
import Lists from 'animo/components/your_lists/Lists';

const YourListsScreen = props => {
    return (
        <View>
            <Lists
                navigation={props.navigation}
            />
        </View>
    );
}

export default YourListsScreen;
